import React, { Component } from "react";

class Footer extends Component {
  render() {
    return (
      <div className="footer">
        <div class="img">
          <img src="./"/>
        </div>
        <div  className="coppy">
           <h3>Coppy Right 2019+</h3> 
        </div>
      </div>
    );
  }
}

export default Footer;
